  "content": "## СОДЕРЖАНИЕ\n1. Обсуждение порядка проведения встречи\n2. Определение плана действий на собрании\n3. Выделение значимых реплик для начала и структурирования делового разговора\n",
  "summary": "На совещании между Иваном Петровым и Марией Сидоровой был обсужден подход к построению повестки встречи и формированию вводных электронные фраз для делового обсуждения. Были определены дальнейшие шаги по использованию согласованных фраз, однако решений о конкретных действиях, проектах и ответственных по задачам принято не было.",
  "decisions": [
    "Обсужден порядок начала деловой встречи с использованием согласованных вводных фраз.",
